
<!DOCTYPE html>
<html lang="uk">
<head>
  <meta charset="UTF-8" />
  <title>Калькулятор окупності СЕС</title>
  <style>
    body {
      font-family: 'Segoe UI', sans-serif;
      background-color: #f5f7fa;
      margin: 0;
      padding: 30px;
      display: flex;
      justify-content: center;
    }
    .calculator {
      background: #fff;
      padding: 32px;
      border-radius: 10px;
      max-width: 540px;
      width: 100%;
      box-shadow: 0 8px 24px rgba(0,0,0,0.1);
    }
    .calculator img {
      display: block;
      max-width: 200px;
      margin: 0 auto 20px;
    }
    h1 {
      text-align: center;
      color: #2e7d32;
      margin-bottom: 24px;
    }
    label {
      font-weight: 600;
      display: block;
      margin-top: 16px;
    }
    input, select {
      width: 100%;
      padding: 10px;
      font-size: 15px;
      margin-top: 5px;
      border-radius: 6px;
      border: 1px solid #ccc;
    }
    button {
      background: #78be20;
      color: #fff;
      font-size: 16px;
      border: none;
      border-radius: 6px;
      padding: 12px;
      width: 100%;
      margin-top: 24px;
      cursor: pointer;
    }
    .results {
      display: none;
      margin-top: 24px;
      background: #e8f5e9;
      padding: 20px;
      border-radius: 6px;
    }
  </style>
</head>

    <h1>Калькулятор окупності СЕС</h1>
    <form id="ecoForm">
      <label>Місячне споживання (кВт⋅год): <input type="number" id="consumption" required></label>
      <label>Тип споживача:
        <select id="consumerType">
          <option value="private">Власне споживання</option>
          <option value="active">Активний споживач</option>
        </select>
      </label>
      <label>Інвертор:
        <select id="inverter">
          <option value="solis">Solis</option>
          <option value="solax">Solax</option>
          <option value="huawei">Huawei</option>
          <option value="deye">Deye (з АКБ на добу)</option>
        </select>
      </label>
      <label>Монтаж:
        <select id="placement" onchange="toggleRoofType()">
          <option value="ground">На землі</option>
          <option value="roof">На даху</option>
        </select>
      </label>
      <div id="roofOptions" style="display:none;">
        <label>Тип даху:
          <select id="roofType">
            <option value="flat">Плоский</option>
            <option value="tile">Металочерепиця</option>
            <option value="profile">Профлист</option>
          </select>
        </label>
      </div>
      <label>Ціна електроенергії (₴/кВт⋅год): <input type="number" id="price" step="0.01" required></label>
      <button type="submit">Розрахувати</button>
    </form>
    <div class="results" id="results">
      <h3>Результати:</h3>
      <ul id="resultList"></ul>
    </div>
  </div>

  <script>
function getInverterCost(inverter) {
    switch(inverter) {
        case 'deye': return 517;
        case 'huawei': return 348;
        case 'solis': return 400;
        case 'solax': return 420;
        default: return 1250;
    }
}
</script><script>
    function toggleRoofType() {
      document.getElementById('roofOptions').style.display =
        document.getElementById('placement').value === 'roof' ? 'block' : 'none';
    }

    document.getElementById('ecoForm').addEventListener('submit', function(e) {
      e.preventDefault();
      const c = +document.getElementById('consumption').value;
      const consumer = document.getElementById('consumerType').value;
      const inv = document.getElementById('inverter').value;
      const price = +document.getElementById('price').value;

      const powerKW = c / 100;
      const batteryKW = inv === 'deye' ? (c / 30) : 0;

      const pricePerKW = { solis: 30000, solax: 32000, huawei: 35000, deye: 38000 };
      const priceBattery = 8000;

      const cost = powerKW * pricePerKW[inv] + batteryKW * priceBattery;
      const annual = consumer === 'active' ? c * price * 12 * 0.9 : c * price * 12;
      const payback = cost / annual;

      document.getElementById('resultList').innerHTML = `
        <li>Потужність СЕС: <b>${powerKW.toFixed(2)} кВт</b></li>
        ${inv === 'deye' ? `<li>АКБ необхідно: <b>${batteryKW.toFixed(2)} кВт⋅год</b></li>` : ''}
        <li>Орієнтовна вартість: <b>${cost.toLocaleString()} ₴</b></li>
        <li>Річна економія: <b>${annual.toLocaleString()} ₴</b></li>
        <li>Окупність: <b>${payback.toFixed(1)} років</b></li>
      `;
      document.getElementById('results').style.display = 'block';
    });
  </script>
</body>
</html>
